import React from "react";

class Sum extends React.Component {
  render() {
    const { response } = this.props;
    const array = [];
    if (response != null) {
      response.nedbetalingsplan.innbetalinger.map((row) => {
        array.push({
          dato: row.dato,
          innbetaling: Math.round(row.innbetaling),
          renter: Math.round(row.renter),
        });
        return array;
      });
    }
    return (
      <h1>hey</h1>
    );
  }
}

export default Sum;
